import React from 'react';

class Video extends React.Component {
  state = {
    que: undefined
  }
  render () {
    return (
      <div>
      <form onSubmit={this.props.gettingVideoId} >
        <div>
          <input type="text" name="searchQuery" autoComplete="off"/>
        </div>
        <div>
          <button>Найти</button>
        </div>
      </form>
      </div>
    )
  }
}

export default Video;
